Tales of the Legion of Super-Heroes #325
Publisher:  DC Comics
Publication Date:  August 1984 - July 1985

This series continues from Legion of Super-Heroes v2 (1980) and runs in tandem with Legion of Super-Heroes v3 (1984).  Tales of the Legion of Super-Heroes continued with new material for a year (issue #314 - 325) and then began reprinting stories from the new Legion of Super-Heroes v3 (1984) for issues #326-354.

